sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
var res;
if(inputs.res.productId)
 res=inputs.res;
 else
 res=JSON.parse(inputs.res);
var req=inputs.req;

if(!res.calculations[0].benefitOption){
    res.calculations[0].benefitOption=req.variantName;
}

outputs.res=JSON.stringify(res);

})(inputs, outputs);

